function replaceQuotes(str) {
    return str.replace(/’/, "'")
}

function replaceDiacritics(str)
{
    let s = str;

    const diacritics =[
        /[\300-\306]/g, /[\340-\346]/g,  // A, a
        /[\310-\313]/g, /[\350-\353]/g,  // E, e
        /[\314-\317]/g, /[\354-\357]/g,  // I, i
        /[\322-\330]/g, /[\362-\370]/g,  // O, o
        /[\331-\334]/g, /[\371-\374]/g,  // U, u
        /[\321]/g, /[\361]/g, // N, n
        /[\307]/g, /[\347]/g, // C, c
    ];

    const chars = ['A','a','E','e','I','i','O','o','U','u','N','n','C','c'];

    for (var i = 0; i < diacritics.length; i++)
    {
        s = s.replace(diacritics[i],chars[i]);
    }

    return s
}

function eqSet(as, bs) {
    return as.size === bs.size && all(isIn(bs), as);
}

function all(pred, as) {
    for (var a of as) if (!pred(a)) return false;
    return true;
}

function isIn(as) {
    return function (a) {
        return as.has(a);
    };
}

const abbreviations = {

    '(?<=^|\s+)dem\.?(?=\s+|$)' : 'democratic',
    '(?<=^|\s+)rep\.?(?=\s+|$)' : 'republic',
    '(?<=^|\s+)pdr(?=\s+|$)' : "people's democratic republic",
    '(^st\.?)' : 'saint',
    '( sar(, china)?)' : 'special administrative region'

}

const expand = str => {

	return Object.keys(abbreviations).reduce(( agg, cur ) => {

		const regexp = new RegExp(cur, 'g')

		return agg.replace(regexp, abbreviations[cur])

	}, str )

}

const stopwords = ['of', 'the', 'and', 'special', 'administrative', 'region']

const unrepublicanise = str => {
    
    if(!/( of)|,/g.test(str)) {
        return str
    }

    if(/democratic/g.test(str)) {
        return str.replace(/republic( of)/g, '')
    }

    return str.replace(/(([^ ,]+) republic( of)?)|(republic( of)?)/g, '')
}

// main function

const parseName = (input, exceptions = {}, throwError = false) => {

    if(!input) { return new Country(input, undefined) }

    let name = unrepublicanise(replaceQuotes(replaceDiacritics(expand(input.toLowerCase()))))

    //if(input.startsWith('Congo')) { console.log(expand(input.toLowerCase())) }

    let entry = exceptions[input]

	if(!entry) {
        entry = nameToAlpha3(name)
	}

	if(!entry) {
		Object.keys(nameToAlpha3Dict).forEach(name2 => {
			const latinised = replaceDiacritics(name2.toLowerCase())

			if(latinised === name) {
				entry = nameToAlpha3(name2)
			}
		})
    }

	if(!entry) {

		const words = new Set(name.toLowerCase().replace(/[,’']/g, '').replace(/-/g, ' ').trim().split(/\s/g).filter( word => stopwords.indexOf(word) < 0 ))

		Object.keys(nameToAlpha3Dict).forEach( name2 => {

            const otherWords = new Set(unrepublicanise(name2.toLowerCase()).replace(/[,']/g, '').replace(/-/g, ' ').trim().split(/\s/g).filter( word => stopwords.indexOf(word) < 0 ))
        
            //if(input.startsWith('Congo')) { console.log(words, otherWords) }


			if(eqSet(words, otherWords)) {

				entry = nameToAlpha3(name2)

			}

		})
	}

	if(!entry) {

		entry = commonNames[name.toLowerCase()]

	}

	if(!entry) {

		entry = Object.keys(alpha3ToNameDict).find( code => code === name )

    }
    
    if(throwError && !allCountriesDict[entry]) {
        throw new Error(`Unable to find country: ${input}`)
    }

	return new Country(input, allCountriesDict[entry])

}

export default {
    alpha3ToName,
    nameToAlpha3,
    alpha3ToNumeric,
    numericToAlpha3,
    alpha3ToAlpha2,
    alpha2ToAlpha3,
    parseName
}